import React from 'react'
import { Link } from 'react-router-dom'

const ChannelCard = ({channelDetail}) => {
  return (
    <div>
      <Link to={`/channelDetail/${channelDetail?.id?.channelId}`}>
        <div style={{display: 'flex', flexDirection: 'column', justifyContent: 'center', textAlign: 'center', color: 'black'}}>
          <img src={channelDetail?.snippet?.thumbnails?.medium?.url}
          alt={channelDetail?.snippet?.title}
          style={{width: '180px', height: '180px'}}/>

          <p style={{fontSize: 14, margin: 0}}>{channelDetail?.snippet?.title}</p>
        </div>
      </Link>
    </div>
  )
}

export default ChannelCard
